import React, { Component } from 'react'
import 'materialize-css';
import { Button, Card, Row, Col, highlight } from 'react-materialize';


export default class Table extends Component {
    constructor(props) {
        super(props);
    }
    redirect() {
        if (!this.props.redirectURL) return
    }
    render() {
        return (
            <div className="tableWrapper">

                <table className="table">
                    <thead>
                        <tr>
                            {this.props.columnHearder.map((headerName, title) => {
                                return <th key={title}>{headerName}</th>
                            })}
                        </tr>
                    </thead>

                    <tbody>
                        {this.props.rowData.map(dataRow => {
                            console.log("EXCEPTION STATUS  ", this.props.exceptionStatus);

                            if (
                                this.props.exceptionStatus[this.props.rowData.indexOf(dataRow)] === 0
                                || this.props.exceptionStatus === 0
                            ) {
                                return (

                                    <tr onClick={() => {
                                        console.log(this.props.rowData.indexOf(dataRow));
                                        if (
                                            this.props.redirectURL == "/test"
                                        ) {

                                            return this.props.navigateRow(
                                                console.log("in tsble if if"),
                                                dataRow[0], this.props.rowData.indexOf(dataRow)
                                            );
                                        }
                                    }}
                                    >
                                        {dataRow.map(tableCell => {

                                            return console.log("in tsble if "), <td>{tableCell}</td>
                                        })}
                                    </tr>
                                );
                            } else {
                                return (
                                    <tr onClick={() => {
                                        console.log(this.props.rowData.indexOf(dataRow));
                                        if (
                                            this.props.redirectURL == "/test"
                                        ) {

                                            return this.props.navigateRow(
                                                console.log("in tsble if else"),
                                                dataRow[0], this.props.rowData.indexOf(dataRow)
                                            );
                                        }
                                    }}
                                    >
                                        {dataRow.map(tableCell => {
                                            return <td>{tableCell}</td>
                                        })}
                                    </tr>
                                );
                            }
                        })}
                    </tbody>
                </table>
            </div>
        );
    }
}
